<template>
  <view class="content">
    <radio-group @change="onSelectModel">
      <label class="model" v-for="(item, index) in models" :key="index">
        <view><radio :value="item.title" :checked="item.title == currentModel" /></view>
        <view>{{ item.title }}</view>
      </label>
    </radio-group>
    <!-- <button @click="setModel">设置模型</button> -->
    <view class="box">
      <image class="qrcode" :src="'data:image/jpeg;base64,' + qrcode"></image>
      <image class="image" v-for="(item, index) in images" :key="index" :src="item"></image>
    </view>
    <view class="prompt">
      <text>{{ prompt }}</text>
    </view>
    <view class="prompt">
      <text>{{ negative_prompt }}</text>
    </view>
    <button @click="create">生成</button>
  </view>
</template>

<script setup>
import { ref, onMounted } from 'vue';

const qrcode = ``;

const loading = ref(false);
const image = ref('');
const images = ref([]);
const models = ref([]);
const currentModel = ref('');

const prompt = `(best quality, masterpiece:1.3), 1 girl, adult woman, teal eyes, gray prom hairstyle,, portrait, looking at viewer, solo, upper body, detailed background, witch hat, witch, magical atmosphere, hair flowing in the wind, purple trimmed dark colored clothes, whirlwind of glowing magic flames in the air, dark magic, (style-swirImagic: 0.8), floating particles, ruined castle background, backlighting, dim light,,RootsBranchesAI,`;
const negative_prompt = `bad-hands, (worst quality:2), (low quality:2), (normal quality:2), lowres, bad anatomy, bad hands, normal quality, ((monochrome)), ((grayscale)), bad proportions, render, 3d, 2d, sketch, painting, digital art, drawing, (deformed, distorted, disfigured:1.3), poorly drawn, wrong anatomy, extralimb, missing limb, floating limbs, (mutated hands and fingers:1.4), disconnected limbs, mutation, mutated, ugly, disgusting, blurry, amputation, bad art, low details, incomplete, undetailed, fused body parts, poorly drawn face, ouf of focus, blurred, smudgy, glossy, glitchy, asian, bad human anatomy, more than two legs`;

const getOptions = () => {
  uni.request({
    url: '/api/sdapi/v1/options',
    method: 'GET',
    success: res => {
      currentModel.value = res.data['sd_model_checkpoint'];
    }
  });
};

const getModels = () => {
  uni.request({
    url: '/api/sdapi/v1/sd-models',
    method: 'GET',
    success: res => {
      models.value = res.data;
    }
  });
};

const onSelectModel = e => {
  currentModel.value = e.detail.value;
};

// const setModel = () => {
//   uni.request({
//     url: '/api/sdapi/v1/options',
//     method: 'POST',
//     data: {
//       sd_model_checkpoint: currentModel.value
//     }
//   });
// };

const create = () => {
  uni.request({
    url: '/api/sdapi/v1/txt2img',
    method: 'POST',
    data: {
      prompt,
      negative_prompt,
      steps: 50,
      cfg_scale: 8,
      width: 512,
      height: 512,
      seed: -1,
      override_settings: {
        sd_model_checkpoint: currentModel.value
      },
      alwayson_scripts: {
        ControlNet: {
          args: [
            {
              input_image: qrcode,
              module: 'none',
              model: 'control_v1p_sd15_qrcode_monster [a6e58995]',
              weight: 1.5,
              guidance_start: 0.0,
              guidance_end: 1.0,
              pixel_perfect: false
            },
            {
              input_image: qrcode,
              module: 'none',
              model: 'control_v1p_sd15_brightness [5f6aa6ed]',
              weight: 0.35,
              guidance_start: 0.65,
              guidance_end: 1.0,
              pixel_perfect: false
            }
          ]
        }
      }
    },
    success: res => {
      images.value.push('data:image/jpeg;base64,' + res.data.images[0]);
    }
  });
};

onMounted(() => {
  getOptions();
  getModels();
});
</script>

<style>
.content {
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}

.box {
  display: flex;
  flex-wrap: wrap;
  margin-top: 20px;
  margin-bottom: 20px;
}

.qrcode {
  display: block;
  height: 400px;
  width: 400px;
  margin: 20px;
}

.show {
  position: relative;
}

.loading {
  position: absolute;
  top: 0;
  left: 0;
  height: 400px;
  width: 400px;
  background-color: rgba(0, 0, 0, 0.3);
  padding: 100px;
  box-sizing: border-box;
}

.image {
  display: block;
  height: 400px;
  width: 400px;
  background-color: aliceblue;
  margin: 20px;
}

.prompt {
  padding: 0 20px 20px;
  font-size: 12px;
}

.model {
  display: flex;
  align-items: center;
  padding: 5px;
}
</style>
